import React from 'react'

function Dropdown({label,options,value,onChange}) {
  return (
    <div>
    <label>
        {label}
        <select value={value} onChange={onChange}>
        {options.map((option) => (
          <option>{option}</option>
        ))}
        </select>
    </label>
    <p>Country Selected: {value}!</p>
    </div>
  )
}

export default Dropdown
